async function getMatches(){var e="";e=document.getElementById("allmatch").checked?"all":"team";var t=document.getElementById("eventCode").value;document.getElementById("viewMatchButton").innerHTML="Requesting Data...";let a=new XMLHttpRequest;a.open("GET",`/api/matches/2023/${t}/qual/${e}`,!0),a.withCredentials=!0,a.onreadystatechange=async()=>{if(a.readyState===XMLHttpRequest.DONE&&200===a.status){console.log("200 ok"),console.log(a.responseText);var e=JSON.parse(a.responseText);document.getElementById("viewMatchButton").innerHTML="Rendering View...";var n="";for(let r=0;r<e.Schedule.length;r++)n+=`<fieldset><label>${e.Schedule[r].description}<br>${e.Schedule[r].startTime.replace("T"," ")}</label><br><span style="color: #FF4000;"><a href="browse?number=${e.Schedule[r].teams[0].teamNumber}&type=team&event=${t}">${e.Schedule[r].teams[0].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[r].teams[1].teamNumber}&type=team&event=${t}">${e.Schedule[r].teams[1].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[r].teams[2].teamNumber}&type=team&event=${t}">${e.Schedule[r].teams[2].teamNumber}</a></span><br><span style="color: #00BFFF;"><a href="browse?number=${e.Schedule[r].teams[3].teamNumber}&type=team&event=${t}">${e.Schedule[r].teams[3].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[r].teams[4].teamNumber}&type=team&event=${t}">${e.Schedule[r].teams[4].teamNumber}</a>&emsp;<a href="browse?number=${e.Schedule[r].teams[5].teamNumber}&type=team&event=${t}">${e.Schedule[r].teams[5].teamNumber}</a></span></fieldset>`;document.getElementById("matchHeader").insertAdjacentHTML("afterend",n),document.getElementById("search").style.display="none",document.getElementById("results").style.display="flex",document.getElementById("viewMatchButton").innerHTML="View"}else 401===a.status||403===a.status?window.location.href="/login":400===a.status?document.getElementById("viewMatchButton").innerHTML="bad request":500===a.status?document.getElementById("viewMatchButton").innerHTML="internal server error":document.getElementById("viewMatchButton").innerHTML="downloading data..."},a.send()}